import './fonction.css'
import React from "react";
//import Popup from "reactjs-popup";



function Test(){

  document.getElementById('pop').style.display = 'inline';
  document.getElementById('display').style.display = 'none';
  document.getElementById('didi').style.display = 'none';

}export default Test;
